// Funciones en JS

// function saludar ( nombre ) {
//     return `Hola, ${ nombre }`;
// }

const saludar2 = ( nombre ) => {
    return `Hola, ${ nombre }`;
}

const saludar3 = ( nombre ) => `Hola, ${ nombre }`;
const saludar4 = () => 'Hola mundo';

console.log( saludar3( 'Goku' ) );
console.log( saludar3( 'Juan' ) );
console.log( saludar4() );

const getUser = () => {
    return {
        uid: 'ABC123',
        username: 'El_Papi1502'
    }
}

console.log( getUser() )
